  public final String yytext() {
    return new String( zzBuffer, zzStartRead, zzMarkedPos-zzStartRead );
  }


  /**
   * Returns the character at position <tt>pos</tt> from the 
   * matched text. 
   * 
   * It is equivalent to yytext().charAt(pos), but faster
   *
   * @param pos the position of the character to fetch. 
   *            A value from 0 to yylength()-1.
   *
   * @return the character at position pos
   */
  public final char yycharat(int pos) {
    return zzBuffer[zzStartRead+pos];
  }


  /**
   * Returns the length of the matched text region.
   */
  public final int yylength() {
    return zzMarkedPos-zzStartRead;
  }


  /**
   * Reports an error that occured while scanning.
   *
   * In a wellformed scanner (no or only correct usage of 
   * yypushback(int) and a match-all fallback rule) this method 
   * will only be called with things that "Can't Possibly Happen".
   * If this method is called, something is seriously wrong
   * (e.g. a JFlex bug producing a faulty scanner etc.).
   *
   * Usual syntax/scanner level error handling should be done
   * in error fallback rules.
   *
   * @param   errorCode  the code of the errormessage to display
   */
  private void zzScanError(int errorCode) {
    String message;
    try {
      message = ZZ_ERROR_MSG[errorCode];
    }
    catch (ArrayIndexOutOfBoundsException e) {
      message = ZZ_ERROR_MSG[ZZ_UNKNOWN_ERROR];
    }

    throw new Error(message);
  } 


  /**
   * Pushes the specified amount of characters back into the input stream.
   *
   * They will be read again by then next call of the scanning method
   *
   * @param number  the number of characters to be read again.
   *                This number must not be greater than yylength()!
   */
  public void yypushback(int number)  {
    if ( number > yylength() )
      zzScanError(ZZ_PUSHBACK_2BIG);

    zzMarkedPos -= number;
  }


  /**
   * Contains user EOF-code, which will be executed exactly once,
   * when the end of file is reached
   */
  private void zzDoEOF() throws java.io.IOException {
    if (!zzEOFDone) {
      zzEOFDone = true;
      yyclose();
    }
  }


  /**
   * Resumes scanning until the next regular expression is matched,
   * the end of input is encountered or an I/O-Error occurs.
   *
   * @return      the next token
   * @exception   java.io.IOException  if any I/O-Error occurs
   */
  public java_cup.runtime.Symbol next_token() throws java.io.IOException {
    int zzInput;
    int zzAction;

    // cached fields:
    int zzCurrentPosL;
    int zzMarkedPosL;
    int zzEndReadL = zzEndRead;
    char [] zzBufferL = zzBuffer;
    char [] zzCMapL = ZZ_CMAP;

    int [] zzTransL = ZZ_TRANS;
    int [] zzRowMapL = ZZ_ROWMAP;
    int [] zzAttrL = ZZ_ATTRIBUTE;

    while (true) {
      zzMarkedPosL = zzMarkedPos;

      yychar+= zzMarkedPosL-zzStartRead;

      boolean zzR = false;
      int zzCh;
      int zzCharCount;
      for (zzCurrentPosL = zzStartRead  ;
           zzCurrentPosL < zzMarkedPosL ;
           zzCurrentPosL += zzCharCount ) {
        zzCh = Character.codePointAt(zzBufferL, zzCurrentPosL, zzMarkedPosL);
        zzCharCount = Character.charCount(zzCh);
        switch (zzCh) {
        case '\u000B':
        case '\u000C':
        case '\u0085':
        case '\u2028':
        case '\u2029':
          yyline++;
          yycolumn = 0;
          zzR = false;
          break;
        case '\r':
          yyline++;
          yycolumn = 0;
          zzR = true;
          break;
        case '\n':
          if (zzR)
            zzR = false;
          else {
            yyline++;
            yycolumn = 0;
          }
          break;
        default:
          zzR = false;
          yycolumn += zzCharCount;
        }
      }

      if (zzR) {
        // peek one character ahead if it is \n (if we have counted one line too much)
        boolean zzPeek;
        if (zzMarkedPosL < zzEndReadL)
          zzPeek = zzBufferL[zzMarkedPosL] == '\n';
        else if (zzAtEOF)
          zzPeek = false;
        else {
          boolean eof = zzRefill();
          zzEndReadL = zzEndRead;
          zzMarkedPosL = zzMarkedPos;
          zzBufferL = zzBuffer;
          if (eof) 
            zzPeek = false;
          else 
            zzPeek = zzBufferL[zzMarkedPosL] == '\n';
        }
        if (zzPeek) yyline--;
      }
      zzAction = -1;

      zzCurrentPosL = zzCurrentPos = zzStartRead = zzMarkedPosL;
  
      zzState = ZZ_LEXSTATE[zzLexicalState];

      // set up zzAction for empty match case:
      int zzAttributes = zzAttrL[zzState];
      if ( (zzAttributes & 1) == 1 ) {
        zzAction = zzState;
      }


      zzForAction: {
        while (true) {
    
          if (zzCurrentPosL < zzEndReadL) {
            zzInput = Character.codePointAt(zzBufferL, zzCurrentPosL, zzEndReadL);
            zzCurrentPosL += Character.charCount(zzInput);
          }
          else if (zzAtEOF) {
            zzInput = YYEOF;
            break zzForAction;
          }
          else {
            // store back cached positions
            zzCurrentPos  = zzCurrentPosL;
            zzMarkedPos   = zzMarkedPosL;
            boolean eof = zzRefill();
            // get translated positions and possibly new buffer
            zzCurrentPosL  = zzCurrentPos;
            zzMarkedPosL   = zzMarkedPos;
            zzBufferL      = zzBuffer;
            zzEndReadL     = zzEndRead;
            if (eof) {
              zzInput = YYEOF;
              break zzForAction;
            }
            else {
              zzInput = Character.codePointAt(zzBufferL, zzCurrentPosL, zzEndReadL);
              zzCurrentPosL += Character.charCount(zzInput);
            }
          }
          int zzNext = zzTransL[ zzRowMapL[zzState] + zzCMapL[zzInput] ];
          if (zzNext == -1) break zzForAction;
          zzState = zzNext;

          zzAttributes = zzAttrL[zzState];
          if ( (zzAttributes & 1) == 1 ) {
            zzAction = zzState;
            zzMarkedPosL = zzCurrentPosL;
            if ( (zzAttributes & 8) == 8 ) break zzForAction;
          }

        }
      }

      // store back cached position
      zzMarkedPos = zzMarkedPosL;

      if (zzInput == YYEOF && zzStartRead == zzCurrentPos) {
        zzAtEOF = true;
            zzDoEOF();
            switch (zzLexicalState) {
            case COMMENT: {
              yybegin(YYINITIAL); error("unclosed comment");
            }
            case 109: break;
            case STR: {
              yybegin(YYINITIAL); error("unclosed string literal");
            }
            case 110: break;
            default:
          {     return tok(EOF);
 }
        }
      }
      else {
        switch (zzAction < 0 ? zzAction : ZZ_ACTION[zzAction]) {
          case 1: 
            { error("invalid character '%s'", yytext());
            }
          case 56: break;
          case 2: 
            { return tok(LITINT, new Integer(yytext()));
            }
          case 57: break;
          case 3: 
            { return tok(ID, yytext().intern());
            }
          case 58: break;
          case 4: 
            { return tok(MINUS);
            }
          case 59: break;
          case 5: 
            { /* skip */
            }
          case 60: break;
          case 6: 
            { builder.setLength(0); strLeft = locLeft(); yybegin(STR);
            }
          case 61: break;
          case 7: 
            { return tok(EQ);
            }
          case 62: break;
          case 8: 
            { return tok(PLUS);
            }
          case 63: break;
          case 9: 
            { return tok(TIMES);
            }
          case 64: break;
          case 10: 
            { return tok(DIV);
            }
          case 65: break;
          case 11: 
            { return tok(MOD);
            }
          case 66: break;
          case 12: 
            { return tok(EXP);
            }
          case 67: break;
          case 13: 
            { return tok(LT);
            }
          case 68: break;
          case 14: 
            { return tok(GT);
            }
          case 69: break;
          case 15: 
            { return tok(LPAREN);
            }
          case 70: break;
          case 16: 
            { return tok(RPAREN);
            }
          case 71: break;
          case 17: 
            { return tok(COMMA);
            }
          case 72: break;
          case 18: 
            { 
            }
          case 73: break;
          case 19: 
            { builder.append(yytext());
            }
          case 74: break;
          case 20: 
            { error("invalid newline in string literal");
            }
          case 75: break;
          case 21: 
            { yybegin(YYINITIAL); return tok(LITSTRING, builder.toString(), strLeft, locRight());
            }
          case 76: break;
          case 22: 
            { return tok(LITDOUBLE, new Double(yytext()));
            }
          case 77: break;
          case 23: 
            { yybegin(COMMENT); commentLevel = 1;
            }
          case 78: break;
          case 24: 
            { return tok(IF);
            }
          case 79: break;
          case 25: 
            { return tok(IN);
            }
          case 80: break;
          case 26: 
            { return tok(DO);
            }
          case 81: break;
          case 27: 
            { return tok(ASSIGN);
            }
          case 82: break;
          case 28: 
            { return tok(LE);
            }
          case 83: break;
          case 29: 
            { return tok(NE);
            }
          case 84: break;
          case 30: 
            { return tok(GE);
            }
          case 85: break;
          case 31: 
            { return tok(AND);
            }
          case 86: break;
          case 32: 
            { return tok(OR);
            }
          case 87: break;
          case 33: 
            { if (--commentLevel == 0) yybegin(YYINITIAL);
            }
          case 88: break;
          case 34: 
            { ++commentLevel;
            }
          case 89: break;
          case 35: 
            { error("invalid escape arguments in string literal");
            }
          case 90: break;
          case 36: 
            { builder.append('\t');
            }
          case 91: break;
          case 37: 
            { builder.append('\r');
            }
          case 92: break;
          case 38: 
            { builder.append('\f');
            }
          case 93: break;
          case 39: 
            { builder.append('"');
            }
          case 94: break;
          case 40: 
            { builder.append('\b');
            }
          case 95: break;
          case 41: 
            { builder.append('\n');
            }
          case 96: break;
          case 42: 
            { builder.append('\\');
            }
          case 97: break;
          case 43: 
            { return tok(LET);
            }
          case 98: break;
          case 44: 
            { return tok(TypeInt);
            }
          case 99: break;
          case 45: 
            { return tok(BCOMMENT);
            }
          case 100: break;
          case 46: 
            { return tok(LITBOOL, true);
            }
          case 101: break;
          case 47: 
            { return tok(THEN);
            }
          case 102: break;
          case 48: 
            { return tok(ELSE);
            }
          case 103: break;
          case 49: 
            { return tok(VOID);
            }
          case 104: break;
          case 50: 
            { return tok(TypeBool);
            }
          case 105: break;
          case 51: 
            { builder.append((char)(Integer.parseInt(yytext().substring(1))));
            }
          case 106: break;
          case 52: 
            { return tok(LITBOOL, false);
            }
          case 107: break;
          case 53: 
            { return tok(WHILE);
            }
          case 108: break;
          case 54: 
            { return tok(TypeString);
            }
          case 109: break;
          case 55: 
            { return tok(TypeDouble);
            }
          case 110: break;
          default:
            zzScanError(ZZ_NO_MATCH);
        }
      }
    }
  }


